import React from 'react'
import 'boxicons'
export const AdminSidebarData = [
    {
        title:"Profile",
        icon:<box-icon name="user" color="#505050"/>,
        Link:'/Profile',
        tooltip:"Profile"
    },
    {
        title:"Announcements",
        icon:<box-icon name="bell" color="#505050"/>,
        Link:'/Announcements',
        tooltip:"Announcements"

    },
    {
        title:"Batches",
        icon:<box-icon name="clipboard" color="#505050"/>,
        Link:'/Attendence',
        tooltip:"Attendence"
    },
    {
        title:"Admins",
        icon:<box-icon name="award" color="#505050"/>,
        Link:'/Result',
        tooltip:"Result"
    },
    {
        title:"Faculty", 
        icon:<box-icon name="time-five" color="#505050"/>,
        Link:'/Time Table',
        tooltip:"Time Table"
    },
    {
        title:"Time Table",
        icon:<box-icon name="calendar" color="#505050"/>,
        Link:'/Holidays',
        tooltip:"Holidays"
    },
    {
        title:"Holidays",
        icon:<box-icon name="edit" color="#505050"/>,
        Link:'/Feedback',
        tooltip:"Feedback"
    },
    {
        title:"Feeda",
        icon:<box-icon name="edit" color="#505050"/>,
        Link:'/Feedback',
        tooltip:"Feedback"
    }

];
